function getTimeUntilLaunch(simulatedNow = null) {
  const now = simulatedNow ? new Date(simulatedNow) : new Date();
  const launch = new Date('2025-07-28T00:00:00-03:00'); // Braslia time (UTC-3)

  const diffMs = launch - now;

  if (diffMs <= 0) {
    return '0 horas';
  }

  const diffHours = diffMs / (1000 * 60 * 60);

  if (diffHours <= 48) {
    const hours = Math.ceil(diffHours);
    return `${hours} ${hours === 1 ? 'hora' : 'horas'}`;
  } else {
    const days = Math.floor(diffHours / 24);
    return `${days} ${days === 1 ? 'dia' : 'dias'}`;
  }
}

$(".clock_wrap p").text(getTimeUntilLaunch());

document.addEventListener("DOMContentLoaded", () => {
  const header = document.querySelector("header"); // ou a classe/id do seu header
  const headerOffset = header ? header.offsetHeight : 0;

  document.querySelectorAll('a[href^="#"]').forEach(anchor => {
    anchor.addEventListener("click", function (e) {
      const targetId = this.getAttribute("href");
      const targetElement = document.querySelector(targetId);

      if (targetElement) {
        e.preventDefault();

        const elementPosition = targetElement.getBoundingClientRect().top + window.pageYOffset;
        const offsetPosition = elementPosition - headerOffset;

        window.scrollTo({
          top: offsetPosition - 10,
          behavior: "smooth"
        });
      }
    });
  });

  const currentParams = new URLSearchParams(window.location.search);
  const button = document.getElementById("subscribe-button");

  if (button && button.href) {
    const url = new URL(button.href, window.location.origin);

    currentParams.forEach((value, key) => {
      url.searchParams.set(key, value); // sobrescreve se j existir
    });

    button.href = url.toString();
  }
});


